(function(){var loadHandler=window['sl_{9DC898D9-2DB2-47BA-9C38-12C6310F48A3}'];loadHandler&&loadHandler(8, '<div id="spr0_700241dd"><div id="spr1_700241dd" class="kern slide"><img id="img3_700241dd" src="data:image/png;base64," width="960px" height="540px" alt="" style="left:0px;top:0px;"/><div id="spr3_700241dd"><div id="spr4_700241dd"><img id="img0_700241dd" src="data:image/png;base64," width="960" height="540" alt=""/></div></div></div><div id="spr2_700241dd" class="kern slide"><div id="spr5_700241dd" style="left:34.216px;top:14.375px;"><div style="width:0px;"><span id="txt0_700241dd" data-width="227.783203" style="left:7.2px;top:2.857px;">Кошмар дантиста</span></div></div><div id="svg3_700241dd" style="left:29.716px;top:68.325px;"><svg width="75" height="9" viewBox="-4.5 -2.25 75 9"><g fill="#ffffff" stroke="none"><path stroke="#ffffff" stroke-width="4.5" stroke-linecap="butt" transform="translate(-34.216377,-70.575119)" d="M34.216,72.825 H99.596"/></g></svg></div><div id="spr6_700241dd" style="left:31.797px;top:97.18px;"><div style="width:0px;"><span id="txt1_700241dd" class="relpos" data-width="190.898438" style="top:1.489px;">Зубы трицератопса</span><span id="txt2_700241dd" class="relpos" data-width="58.701172" style="left:-0.005px;top:1.489px;"> Teeth</span></div></div><div id="spr7_700241dd" style="left:33.527px;top:136.597px;"><div style="width:0px;"><span id="txt3_700241dd" data-width="347.484375" style="top:2.206px;">Зубы трицератопса являются одними из самых</span></div><div style="width:0px;"><span id="txt4_700241dd" data-width="357.531250" style="top:26.206px;">сложных из всех животных, которые когда-либо</span></div><div style="width:0px;"><span id="txt5_700241dd" data-width="42.429688" style="top:49.264px;">жили.</span></div><div style="width:0px;"><span id="txt6_700241dd" class="relpos" data-width="107.632813" style="top:88.984px;">Состоящий из </span><span id="txt7_700241dd" class="relpos" style="left:-0.005px;top:88.984px;">5</span><span id="txt8_700241dd" class="relpos" data-width="250.218750" style="left:-0.01px;top:88.984px;"> слоев и до 40 &quot;батарей&quot; (рядов) с</span></div><div style="width:0px;"><span id="txt9_700241dd" data-width="355.328125" style="top:114.206px;">каждой стороны челюсти взрослая особь могла</span></div><div style="width:0px;"><span id="txt10_700241dd" data-width="182.976563" style="top:137.264px;">похвастать до 800 зубов!</span></div><div style="width:0px;"><span id="txt11_700241dd" data-width="349.882813" style="top:176.984px;">Эти слои позволяли трицератопсу пробиваться</span></div><div style="width:0px;"><span id="txt12_700241dd" data-width="355.171875" style="top:202.206px;">через массивные количества листьев, стеблей и</span></div><div style="width:0px;"><span id="txt13_700241dd" class="relpos" data-width="313.054688" style="top:226.206px;">древесных ветвей. Когда вы весите целых </span><span id="txt14_700241dd" class="relpos" style="left:-0.005px;top:226.206px;">2</span></div><div style="width:0px;"><span id="txt15_700241dd" class="relpos" data-width="125.789063" style="top:250.206px;">взрослых слона</span><span id="txt16_700241dd" class="relpos" data-width="212.187500" style="left:-0.005px;top:250.206px;">, вам нужно много еды! Но к</span></div><div style="width:0px;"><span id="txt17_700241dd" data-width="252.742188" style="top:273.264px;">счастью, они были травоядными...</span></div><div style="width:0px;"><span id="txt18_700241dd" data-width="318.945313" style="top:312.984px;">Износ всего этого жевания был огромным,</span></div><div style="width:0px;"><span id="txt19_700241dd" class="relpos" data-width="293.398438" style="top:338.206px;">следовательно, так много зубов, чтобы </span><span id="txt20_700241dd" class="relpos" data-width="73.429688" style="left:-0.005px;top:338.206px;">заменить</span></div><div style="width:0px;"><span id="txt21_700241dd" data-width="277.968750" style="top:358.953px;">те, которые со временем пострадали.</span></div></div><div id="spr8_700241dd" style="left:148px;top:-42.115px;"><img id="img1_700241dd" src="data:image/png;base64," width="1025" height="624" alt="Triceratops, facing us; it looks like he is smiling." style="left:0.204px;top:0.115px;"/></div><div id="spr9_700241dd" style="left:739.879px;top:0px;"><div id="spr10_700241dd"><img id="img2_700241dd" src="data:image/png;base64," width="220" height="184" alt="" style="left:0.061px;"/></div></div></div></div>');})();